webpackJsonp([89,426],{2:function(t,e){t.exports="data:image/png;base64,"},257:function(t,e){t.exports="data:image/png;base64,"},1636:function(t,e,l){t.exports={frontmatter:l(647),content:l(2817)}},2817:function(t,e,l){t.exports="<section class=tips id=laeringsmal> <h1 class=tips id=laeringsmal>Læringsmål</h1> <ul> <li>beskrive og gjennomføre spegling, rotasjon og parallellforskyving</li> <li>beskrive plassering og flytting i rutenett, på kart og i koordinatsystem, med og utan digitale hjelpemiddel, og bruke koordinatar til å berekne avstandar parallelt med aksane i eit koordinatsystem</li> </ul> </section> <section class=intro id=introduksjon> <h1 class=intro id=introduksjon>Introduksjon</h1> <p>I denne oppgaven skal vi importere en geometrisk figur og deretter <code class=blockmotion>rotere</code> den. OBS! Har du allerede løst oppgaven med rotasjon rundt egen akse kan du hoppe over Steg 1 og heller bare laste inn den forrige oppgaven din fra &quot;Mine ting&quot;-mappen.</p> <figure><img src="+l(257)+' alt=""></figure> </section> <section class=activity id=steg-1-forberedelser> <h1 class=activity id=steg-1-forberedelser>Steg 1: Forberedelser</h1> <p><em>For å gjøre det enkelt å komme i gang, henter vi inn en ferdig figur fra biblioteket til Scratch. Denne figuren er tilnærmet lik en likebeint trekant</em></p> <section class=check id=sjekkliste> <h2 class=check id=sjekkliste>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_0><label for=cbx_0> Start et nytt prosjekt.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_1><label for=cbx_1> Slett kattefiguren ved å høyreklikke på den og velge <code>slett</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_2><label for=cbx_2> Legg til en ny figur. Klikk på <img src='+l(2)+" alt=\"Velg figur fra biblioteket\">-knappen og velg trollmannshatten. Vi har brukt <code>Ting/Wizard Hat</code>-figuren.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_3><label for=cbx_3> Gi den nye figuren navnet <code>Hattulf</code> ved å klikke på <code>i</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_4><label for=cbx_4> Før vi begynner med selve oppgaven, skal vi legge inn en liten hjelpefunksjon om noe uventet skulle skje:</label></p> <pre class=blocks>når [n v] trykkes\nvis\npek i retning [90 v]\ngå til x: (0) y: (0)\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_5><label for=cbx_5> Skulle noe uventet skje nå, trenger du bare å trykke på tasten N på tastaturet, så vil Hattulf gå tilbake til utgangspunktet, slik at du kan prøve på nytt.</label></p> </li> </ul> </section> <section class=flag id=test-prosjektet> <h2 class=flag id=test-prosjektet>Test prosjektet</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_6><label for=cbx_6> Bruk musepekeren og flytt Hattulf til et nytt sted i bildet.</label></li> <li class=task-list-item><input type=checkbox id=cbx_7><label for=cbx_7> Trykk N på tastaturet ditt. Hopper Hattulf tilbake til midten av bildet? Hvis ja: Gå videre til steg 2. Hvis nei: Feilsøk koden din, fiks den, test på nytt.</label></li> </ul> </section> </section> <section class=activity id=steg-2-rotasjon-i-et-koordinatsystem> <h1 class=activity id=steg-2-rotasjon-i-et-koordinatsystem>Steg 2: Rotasjon i et koordinatsystem</h1> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_8><label for=cbx_8> Importer bakgrunnen 'xy-grid'</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_9><label for=cbx_9> Velg Hattulf. I scriptet</label></p> <pre class=blocks>når [n v] trykkes\nvis\npek i retning [90 v]\ngå til x: (0) y: (0)\n</pre> </li> </ul> <p>endrer vi x-verdien til -100, og y-verdien til 100.</p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_10><label for=cbx_10> Legg merke til punktet der x-aksen (vannrett) og y-aksen (loddrett) krysses. Det punktet kalles origo og er det stedet hvor både x = 0 og y = 0.</label></li> </ul> <section class=flag id=test-prosjektet-2> <h2 class=flag id=test-prosjektet-2>Test prosjektet</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_11><label for=cbx_11> Trykk N på tastaturet. Hattulf skal havne akkurat der de to grå linjene for X = -100 og Y = 100 krysses.</label></li> <li class=task-list-item><input type=checkbox id=cbx_12><label for=cbx_12> Hvis alt ser greit ut, fortsett til neste steg.</label></li> <li class=task-list-item><input type=checkbox id=cbx_13><label for=cbx_13> Hvis noe ikke ser riktig ut, prøv å finne ut om du har gjort en feil i koden din og prøv å trykke N på nytt.</label></li> </ul> </section> </section> <section class=activity id=steg-3-hattulf-roteres-rundt-origo> <h1 class=activity id=steg-3-hattulf-roteres-rundt-origo>Steg 3: Hattulf roteres rundt origo</h1> <p>Nå skal vi altså rotere Hattulf rundt origo på en ganske enkel måte.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_14><label for=cbx_14> Lag dette skriptet til Hattulf:</label></p> <pre class=blocks>når [pil høyre v] trykkes\ngå (200) steg\nvend høyre (90) grader\n</pre> </li> </ul> <section class=flag id=test-prosjektet-3> <h2 class=flag id=test-prosjektet-3>Test prosjektet</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_15><label for=cbx_15> Trykk tasten &quot;pil høyre&quot; på tastaturet. Hva skjer? Fortsett til Hattulf er tilbake ved startpunktet sitt.</label></li> <li class=task-list-item><input type=checkbox id=cbx_16><label for=cbx_16> Hvis du studerer koden vi nettopp laget til Hattulf, ser du at vi ber Hattulf gå 200 steg. Hvorfor må vi gå så langt?</label></li> <li class=task-list-item><input type=checkbox id=cbx_17><label for=cbx_17> Prøv å endre på antall steg Hattulf tar. Ender Hattulf opp på samme sted som han startet etter at du har trykket &quot;pil høyre&quot; fire ganger?</label></li> </ul> </section> </section> <section class=activity id=steg-4-en-ny-venn> <h1 class=activity id=steg-4-en-ny-venn>Steg 4: En ny venn!</h1> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_18><label for=cbx_18> Legg til en ny figur. Denne gangen skal du få velge figur selv. Hvis den blir veldig stor i forhold til alt det andre, kan du krympe den ned til en passelig størrelse. Kall den nye figuren for &quot;Venn&quot;</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_19><label for=cbx_19> Lag en kopi av &quot;Når N trykkes&quot;-skriptet fra Hattulf til Venn, men endre y-verdien til 50.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_20><label for=cbx_20> Kopier også over &quot;Når pil høyre trykkes&quot;-skriptet fra Hattulf, men halver både antall steg og antall grader i skriptet.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_21><label for=cbx_21> For litt mer moro kan du legge til en linje med kode som skrur på <code class=blockpen>pennen</code> for begge figurene. Øverste del av pil høyre-skriptet skal da se slik ut:</label></p> <pre class=blocks>når [pil høyre v] trykkes\npenn på\n</pre> </li> </ul> <section class=flag id=test-prosjektet-4> <h2 class=flag id=test-prosjektet-4>Test prosjektet</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_22><label for=cbx_22> Trykk pil høyre. Hva skjer?</label></li> <li class=task-list-item><input type=checkbox id=cbx_23><label for=cbx_23> Trykk pil høyre slik at Hattulf kommer tilbake til utgangspunktet. Hvor langt har Venn kommet nå?</label></li> <li class=task-list-item><input type=checkbox id=cbx_24><label for=cbx_24> Hvor mange ganger på du trykke for at Venn kommer tilbake til utgangspunktet?</label></li> <li class=task-list-item><input type=checkbox id=cbx_25><label for=cbx_25> Klarer du å justere utgangspunktet til Venn, slik at figuren har like lang avstand til origo for hver gang du trykker pil høyre?</label></li> </ul> </section> </section> "}});